import React, { useEffect, useState } from "react";

function ReportDashboard() {
    const [reps, setReps] = useState([{
        state: '',
        type: '',
        message: ''
    }])

    // useEffect(() => {
    //     fetch("/reportdashboard")
    //         .then(res => {
    //             console.log(res)
    //             return res.json()

    //         }).then(jsonRes =>
    //             setReps(jsonRes));

    // })

    return <div className="container">
        <h2>Report Dashboard</h2>
        <h1>Hello</h1>

        {reps.map(rep =>
            <ul key="{state}">
                <li >{rep.state}</li>
                <li>{rep.type}</li>
                <li>{rep.message}</li>
            </ul>
        )}
    </div>
}

export default ReportDashboard;
